import Button from "../Button/Button";
import BtnIcon from "../BtnIcon/BtnIcon";
import style from "./BtnIcons.module.css";

import { AiOutlineBarChart } from "react-icons/ai";
import { AiFillMoneyCollect } from "react-icons/ai";
import { BsNewspaper } from "react-icons/bs";

function BtnIcons(props) {
  return (
    <>
      <BtnIcon
        classBtn={
          props.news
            ? `${style["btn--icon"]} ${style["btn--icon--news"]}`
            : `${style["btn--icon"]}`
        }
        onClick={props.onClick}
        data-id="chart"
        text={props.text}
      >
        <AiOutlineBarChart className={style.icon} />
      </BtnIcon>
      <Button
        type="button"
        className={
          props.news
            ? `${style["btn--icon"]} ${style["btn--icon--news"]}`
            : `${style["btn--icon"]}`
        }
      >
        <div
          onClick={props.onClick}
          data-id="chart"
          className={style["btn__inner"]}
        ></div>

        <span className={style["btn__text"]}>chart</span>
      </Button>
      <Button
        type="button"
        className={
          props.news
            ? `${style["btn--icon"]} ${style["btn--icon--news"]}`
            : `${style["btn--icon"]}`
        }
      >
        <div
          onClick={props.onClick}
          data-id={props.news ? "news" : "info"}
          className={style["btn__inner"]}
        ></div>
        {props.news ? (
          <BsNewspaper className={style.icon} />
        ) : (
          <AiFillMoneyCollect className={style.icon} />
        )}
        <span className={style["btn__text"]}>
          {props.news ? "news" : "info"}
        </span>
      </Button>
    </>
  );
}

export default BtnIcons;
